tables.table_schema:
CREATE TABLE feeding_strategies (
  id INT PRIMARY KEY,
  type VARCHAR(50) NOT NULL,
  amount DECIMAL(10, 2) NOT NULL,
  time TIMESTAMP NOT NULL,
);

CREATE TABLE production_data (
  id INT PRIMARY KEY,
  fish_species VARCHAR(50) NOT NULL,
  weight DECIMAL(10, 2) NOT NULL,
  date TIMESTAMP NOT NULL,
);

CREATE TABLE yield_optimization (
  id INT PRIMARY KEY,
  strategy_id INT NOT NULL,
  production_id INT NOT NULL,
  optimization_score DECIMAL(10, 2) NOT NULL,
);

CREATE TABLE aquaculture_operations (
   operation_id INT PRIMARY KEY,
   operation_date DATE,
   location VARCHAR(255),
   water_temperature FLOAT
);

CREATE TABLE fish_species (
   species_id INT PRIMARY KEY,
   species_name VARCHAR(255),
   optimal_temperature FLOAT,
   optimal_ph FLOAT
);

CREATE TABLE feed_recipe (
   recipe_id INT PRIMARY KEY,
   recipe_name VARCHAR(255),
   protein_content FLOAT,
   fat_content FLOAT
);

CREATE TABLE feeding_schedule (
    id INT PRIMARY KEY,
    date DATE,
    feed_type VARCHAR(255),
    quantity DECIMAL(10, 2)
);

CREATE TABLE fish_stock (
    id INT PRIMARY KEY,
    species VARCHAR(255),
    quantity INT,
    average_weight DECIMAL(10, 2)
);

CREATE TABLE water_quality (
    id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    temperature DECIMAL(5, 2),
    ph_level DECIMAL(3, 2)
);

CREATE TABLE feeding_logs (
    id INT PRIMARY KEY,
    fish_id INT,
    feed_time TIMESTAMP,
    consumed_quantity DECIMAL(10, 2)
);

CREATE TABLE harvest_records (
    id INT PRIMARY KEY,
    date DATE,
    fish_id INT,
    total_weight DECIMAL(10, 2)
);
